import React from 'react';
import './App.css';
import AppRoutes from '../Routes/Routes';
import Header from '../Header'
// import Footer from '../Footer/Footer';
import Sidebar from '../Sidebar/Sidebar';


const App = () => {
  return (
  <div className="app">
    <Header/> 
    <div className="container">
      <AppRoutes/>
      <Sidebar/>
    </div>

   {/* <Footer/> */}
  </div>

  );
};

export default App;
